import { Button, styled } from "@mui/material";
import { red } from "@mui/material/colors";

const StyledButton = styled(Button)(
  ({ theme, size, fullWidth, customStyles }) => ({
    borderRadius: 'px',
    padding: size === 'small' ? '6px 12px' : size === 'large' ? '14px 24px' : '10px 20px', 
    width: fullWidth ? '100%' : 'auto', 
  })
);
const CustomButton = (props) => {
  const {
    startIcon,
    endIcon,
    size,
    customStyles,
    fullWidth,
    children,
    ...other
  } = props;
  return (
    <>
      <StyledButton
        size={size}
        fullWidth={fullWidth}
        startIcon={startIcon}
        endIcon={endIcon}
        {...props}
      >
        {props.children || "Sign In"}
      </StyledButton>
    </>
  );
};

export default CustomButton;
